import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';

function Header() {
  return (
    <AppBar position="fixed" sx={{ backgroundColor: '#ffffff', boxShadow: 'none', borderBottom: '1px solid #f8f9fa' }}>
      <Toolbar>
        <Typography variant="h6" sx={{ flexGrow: 1, color: '#333333', fontWeight: 'bold' }}>
          Fishing App
        </Typography>
        <Box>
          <Button color="inherit" href="#login" sx={{ marginRight: 2, color: '#007bff' }}>
            Log In
          </Button>
          <Button variant="contained" href="#signup" sx={{ backgroundColor: '#007bff', color: '#ffffff', '&:hover': { backgroundColor: '#0056b3' } }}>
            Sign Up
          </Button>
        </Box>
      </Toolbar>
    </AppBar>
  );
}

export default Header;
